  router.post('/login',function(req,res,next){
sess=req.session;
if(!sess.user){  
var id=req.body.id;
    var password=req.body.password;
  
  
    mngmnt.getUserByID(id,function(err, user){
      if(err) throw err;
      if(!user){
          console.log("unknown user");
          //res.redirect('/mngmnt/unknw');
          res.status(500).send('Unauthorized User');
          return;
      }
      mngmnt.comparePassword(password, user.password, function(err, isMatch){
        if(err) throw err;
        if(isMatch){
           console.log('login successful');      
           sess.user=user._id;
           sess.type='mngmnt';
           sess.grv_type=user.Gtype;
           sess.name=user.name;
           sess.email=user.emailid;
           sess.active=1;
           res.send('success'); 
       
        }
        else{
          console.log('invalid password');
         res.status(500).send('pass');
        }
      })
      });
    }
    else{
      res.status(500).send('some');
    }
    });


